 if(favSeries == 'netFlix'){
  {Sdata.map((val) =>{
    return (
      <Card 
       key = {val.id}
       imgsrc={val.imgsrc}
       title={val.title} 
       sname={val.sname}
       link={val.link}
      />
     );
  })}
 }else{

 }
 

